def networkx(filename):
    """--------------------------------------------------------------------------------
    function:       把一个含有边的txt数据集表示成networkx
    Parameters:     filename：文件名称 .txt格式
    Returns：       G：表示成networkx的图
    ---------------------------------------------------------------------------------"""
    fin = open(filename, 'r')
    G = nx.Graph()
    for line in fin:
        data = line.split()
        if data[0] != '#':
            G.add_edge(int(data[0]), int(data[1]))
    return G

def compare_comm(C, real_C):
    """--------------------------------------------------------------------------------
         function:       计算找到的社区和已知社区之间的指标值
         Parameters:     C：找到的社区
                         know_C：已知社区
         Returns：       r：召回率
                         p：精确率
                         f:F1分数
                         j:Jaccard系数
         ---------------------------------------------------------------------------------"""
    intersect = set(C) & set(real_C)
    p = round(len(intersect) / len(set(C)), 4)
    r = round(len(intersect) / len(set(real_C)), 4)
    f = round((2 * p * r) / (p + r + 1e-9), 4)
    j = round(len(intersect) / (len(C) + len(real_C) - len(intersect)), 4)
    return r, p, f, j

def com_node_index(file):
    """--------------------------------------------------------------------------------
               function:       将社区转换为字典的形式存储
               Parameters:     filename：文件名称 .txt格式 存放社区的文件路径
               Returns：       node_list:社区数据集中所有的节点，无重复的节点，以列表的形式存储
                               node_length:每行社区的节点个数之和
                               com_index：把社区以字典的形式存储
                               node_com_index:以字典的形式存放，节点所在的社区编号
               ---------------------------------------------------------------------------------"""
    com_index = {}
    node_com_index = {}
    node_list = []
    with open(file, 'r') as f:
        for i, line in enumerate(f.readlines()):
            line = line.strip("\n").split()
            lines = list(map(int, line))
            node_list.extend(lines)
            com_index[i] = lines
        f.close()
    node_length = len(node_list)
    node_list = list(set(node_list))
    for i in node_list:
        com_dex = []
        for j in com_index.values():
            if i in j:
                index = list(com_index.keys())[list(com_index.values()).index(j)]
                com_dex.append(index)
        node_com_index.update({i: com_dex})
    return node_list, node_length, com_index, node_com_index

def calculate_degree(com, G):
    """--------------------------------------------------------------------------------
     function:       计算社区com中节点的度
     Parameters:     com：社区
                     G：网络图
     Returns：       社区内节点的平均度
     ---------------------------------------------------------------------------------"""
    g = []
    for i in com:
        n = G.neighbors(i)
        t = list(set(n).intersection(set(com)))
        g.append(len(t))
    de = sum(g) / len(com)
    return de

def cal_sum_neighbors(nodei, com, G):
    """--------------------------------------------------------------------------------
             function:       计算nodei在社区com的邻居数
             Parameters:     nodei：节点
                             com：社区
                             G: 网络图
             Returns：       length:节点在社区的邻居数
             ---------------------------------------------------------------------------------"""
    neigh = G.neighbors(nodei)
    length = len(set(neigh).intersection(com))
    return length

def calculate_inedges_outedges(C, G):
    """--------------------------------------------------------------------------------
                 function:       计算社区C的内部边数和外部边数
                 Parameters:     C：社区
                                 G：网络图
                 Returns：       inedges:社区的内部边数
                                 outedges：社区的外部边数
                 ---------------------------------------------------------------------------------"""
    inedges = len(G.subgraph(C).edges())
    node_nei = []
    for i in C:
        node_nei.extend(list(G.neighbors(i)))
    N = list(set(node_nei) - set(C))
    out = []
    for j in N:
        b = list(G.neighbors(j))
        yyy = list(set(b).intersection(set(C)))
        g = len(yyy)
        out.append(g)
    outedges = sum(out)
    return inedges, outedges

def cal_N(C,G):
    #计算社区C的邻居N
    ggg = []
    for i in C:
        dd = list(G.neighbors(i))
        ggg.extend(dd)
    N = list(set(ggg) - set(C))
    return N

