def cal_common_nei(N, G):
    """--------------------------------------------------------------------------------
                     function:      计算N中节点的公共邻居个数
                     Parameters:     N：社区的邻居节点
                                     G: 网络图
                     Returns：       nei_length: 公共邻居个数
                     ---------------------------------------------------------------------------------"""
    nei_length = []
    for i in N:
        second_nei = list(G.neighbors(i))
        length = len(set(N) & set(second_nei))
        nei_length.append(length)
    return nei_length

def pick_max_degree(node_index, N, G):
    """--------------------------------------------------------------------------------
                     function:      公共邻居个数一样，挑选节点度大的节点
                     Parameters:     node_index：节点索引
                                     N： 邻居节点
                                     G: 网络图
                     Returns：      second_node: 度大的节点
                     ---------------------------------------------------------------------------------"""
    f = []
    for m in node_index:
        f.append(N[m])
    ff = []
    for n in f:
        ff.append(G.degree(n))
    max_length_index = ff.index(max(ff))
    second_node = f[max_length_index]
    return second_node

