def cal_sub_com(G, com):
    """--------------------------------------------------------------------------------
                    function:       提取已知社区的节点子图
                    Parameters:     com：给定的已知社区
                                    G:网络图
                    Returns：       fff: 已知社区对应的节点子图
                    ---------------------------------------------------------------------------------"""
    dddd = []
    for i in com:
        for j in i:
            d = list(G.neighbors(j))
            dd = list(set(d) & set(i))
            dd.append(j)
            dddd.append(sorted(dd))
    ffff = []
    for ii in dddd:
        if len(ii) >= 2 and ii not in ffff:
            ffff.append(ii)
    return ffff

def cal_weight(G, com):
    """--------------------------------------------------------------------------------
                    function:       计算节点子图间的相似性以及节点子图对应的权
                    Parameters:     com：节点子图
                                    G:网络图
                    Returns：       e: 子图
                                    b： 权重
                    ---------------------------------------------------------------------------------"""
    s = []
    for i in com:
        g1 = nx.Graph()
        edges1 = G.subgraph(i).edges()
        g1.add_nodes_from(i)
        g1.add_edges_from(edges1)
        adj1 = np.array(nx.adjacency_matrix(g1).todense())
        g11 = Graph(adj1)
        sp = ShortestPath(normalize=True, with_labels=False)
        a = sp.fit_transform([g11])
        ss = []
        for j in com:
            g2 = nx.Graph()
            edges2 = G.subgraph(j).edges()
            g2.add_nodes_from(j)
            g2.add_edges_from(edges2)
            adj2 = np.array(nx.adjacency_matrix(g2).todense())
            g22 = Graph(adj2)
            aa = sp.transform([g22])
            aaa = aa[0].tolist()
            aaa = aaa[0]
            ss.append(aaa)
        s.append(ss)
    for i in s:
        for j in range(len(i)):
            if i[j] != 1.0:
                i[j] = 0
    c = []
    for i in s:
        c.append(s.index(i))
    c_dict = {}
    for i in c:
        c_dict[i] = c.count(i)
    a = c_dict.keys()
    b = list(c_dict.values())
    e = []
    for i in a:
        e.append(com[i])
    return e, b

def cal_inner_outer_C(C, G):
    """--------------------------------------------------------------------------------
                    function:       计算社区C的内部边数和外部边数
                    Parameters:     C：社区
                                    G：网络图
                    Returns：       inedges:社区的内部边数
                                    outedges：社区的外部边数
                    ---------------------------------------------------------------------------------"""

    inedges = G.subgraph(C).edges()
    node_nei = []
    for i in C:
        node_nei.extend(list(G.neighbors(i)))
    N = list(set(node_nei) - set(C))
    a = []
    for ii in N:
        a.extend(G.edges(ii))
    outedges = []
    for iii in a:
        if (list(iii)[1] in C):
            outedges.append(iii)
    return inedges, outedges

def graph_subgraph_weight(com, file2):
    """--------------------------------------------------------------------------------
                    function:       计算已知社区的社区子图，节点子图，以及节点子图的权重
                    Parameters:     Com：社区
                                    file2：网络图
                    Returns：       com:社区的内部边数
                                    subgraph：社区的外部边数
                                    weight；权重
                    ---------------------------------------------------------------------------------"""
    G = networkx(file2)
    ffff = cal_sub_com(G, com)
    subgraph, weight = cal_weight(G, ffff)
    return com, subgraph, weight


def get_knowcom(file):
    #获得数据集的已知社区
    com1=[]
    with open(file,'r') as f:
        for line in f.readlines():
            line=line.strip().split()
            line=list(map(int,line))
            com1.append(line)
    knowcom=[com1[:10],com1[10:20],com1[20:30],com1[30:40],com1[40:50]]
    return knowcom


